buildColl.remove({ _id: { $in: blacklist } });
playColl.remove({ _id: { $in: blacklist } });

buffer = [];

function process(buf) {
  const existingIds = new Set(playColl.distinct('_id', { _id: { $in: buf.map(p => p._id) } }));
  const missing = buf
    .filter(p => !existingIds.has(p._id))
    .map(p => ({
      _id: p._id,
      gameId: p.gameId,
      fen: p.fen,
      themes: [],
      glicko: {
        r: 1500,
        d: 500,
        v: 0.09,
      },
      plays: NumberInt(0),
      vote: 1,
      vu: NumberInt(10),
      vd: NumberInt(0),
      line: p.moves.join(' '),
      cp: p.cp,
    }));
  if (missing.length) playColl.insertMany(missing, { ordered: false });
}

buildColl.find({ _id: { $nin: blacklist } }).forEach(p => {
  if (p.moves.length < 2) return;
  buffer.push(p);
  if (buffer.length >= 1000) {
    process(buffer);
    buffer = [];
  }
});

process(buffer);
